import React, { Component } from "react";
class InputCurrency extends Component {
  state = {
    id: "",
    text: ""
  };

  constructor() {
    super();
    this.state.id = this.props.dataCurrency.id;
    this.state.text = this.props.dataCurrency.text;
  }

  render() {
    return (
      <React.Fragment>
        <span>{this.state.id}</span>
        <input type="text" />
      </React.Fragment>
    );
  }
}

export default InputCurrency;
